import React from 'react';
const Form = (props) => {
  const mystyle = {
  color: "white",
  backgroundColor: "DodgerBlue",
  padding: "10px",
  fontFamily: "Arial"
};
  return (
<form onSubmit={(event) => props.handleUserFormSubmit(event)}>
    <p style={mystyle}> Search:</p>
      <label>
        <input name="username"
        type="text"
        placeholder="GitHub username"
        required
        value={props.formData.username}
        onChange={props.handleFormChange}
      />
      </label>
      <div>
      <input
        type="submit"
        value="Submit"
      />
    </div>
    </form>
)};
export default Form;
